%[text] ## 2.2 Sensitivity to model mis-match and feed-forward (equilibrium) thrust
%[text] In this section, we will assess how the controller handles inaccuracies of model parameters and how this impacts the drone behavior. To facilitate the analysis, we are going to use an app. The app is an easy way to connect intuitive controls such as sliders and dropdowns with callback functions that e.g. adjust variables in our Simulink models. The App can be started with the command below. If you would like to have a look at the implementation type `edit PS_Quadcopter_Lab_app` in the command line.
%[text] The app features a settings panel on the left where you can make changes to your Simulink model. The simulate button runs the simulation in the background, gathers the results and displays them in the plot. We also use these results to create a 3D visualization of the drone. This way, one can get a better understanding of the drone behaviour.
PS_Quadcopter_Lab_app %[output:73e82d5f]
%[text] Once the app is open, load your Simulink model from the previous task by clicking on the "Load Model" button. Note the app will automatically display the panel for the corresponding exercise. This is based on the filename of your model.
%%
%[text] ### 2.2.1 Sensitivity to Deviations of Mass
%[text] Use the sliders in the settings panel to adjust the mass used for the controller and measure the steady-state offset from the reference.
%[text] ```matlabCodeExample
%[text] % adjusting the sliders modifies the model variable nrotor_vehicle.mass_for_controller or nrotor_vehicle.layout_for_controller defined by the
%[text] % files exercise01_simulation_parameters.m and exercise01_compute_equilibrium_thrusts.m:
%[text] 
%[text] nrotor_vehicle.mass_for_controller = nrotor_vehicle.mass_true*(1+mass_deviation*0.01); %mass_deviation in percent is given by slider
%[text] 
%[text] x_offset = x_baseline * layout_deviation * 0.01; %layout deviation in percent is given by slider
%[text] y_offset = y_baseline * layout_deviation * 0.01;
%[text] 
%[text] nrotor_vehicle.layout_for_controller = nrotor_vehicle.layout_true + repmat( [x_offset;y_offset;0.000] , 1 , size(nrotor_vehicle.layout_true,2));
%[text] nrotor_vehicle.equilibrium_thrust = exercise02_compute_equilibrium_thrusts(nrotor_vehicle.layout_for_controller,nrotor_vehicle.mass_for_controller,g);
%[text] ```
%%
%[text] Make several runs using different mass deviations. Is the offset of the response linear in the mis-match?
%[text] ```
%[text] Hint: to answer this you can read the offset from the plot using data tips.
%[text] ```
